import React from 'react';
import AppBar from '../components/AppBar';
import styled from 'styled-components';
import TotalWrap from '../styled-components/TotalWrap';
import WrapBox from '../styled-components/WrapBox';
import SideBar from '../components/SideBar';
import tube from '../images/YoutubeLogo.png';
import YoutubeSlider from '../components/YoutubeSlider';

export default function Top20() {
    return (
        <div>
            <TotalWrap>
            <AppBar/>

            <WrapBox>
            <SideBar/>
            <OttBox>
                <OttLogoImg>
                    <YoutubeImg src={tube} alt ='youtubeLogo'/>
                </OttLogoImg>
                <SliderBox>
                    <YoutubeSlider/>
                </SliderBox>




            </OttBox>
            </WrapBox>
            </TotalWrap>
        </div>
    );
}

const OttBox = styled.div`

`;
const OttLogoImg = styled.div`
display:flex;
width: 170px;
margin:50px;

`;
const YoutubeImg = styled.img`
  width:100%;  
`;
const SliderBox = styled.div`
/* width:100%; */
/* height:400px; */
`;
